- input: "TEXT\x1CC00136457\x1C1\x1C\x1CF3XA\x1CIn response to the RFAI of December
    28, the walkbooks were used for exempt voter drive activity on behalf of the Republican
    Party Presidential and Vice Presidential nominees.  No public advertising was
    involved.  Funds used for this activity were permissible under the FECA, and none
    of the funds used were designated for a particular candidate.  Payments were not
    made from transfers in from the national committee to specifically fund this activity.
    \ Furthermore, payments for mail and campaign materials reported on Schedule B
    for line 30(b) were materials used in exempt volunteer activity, and thus are
    appropriately reported on that schedule.  Purpose descriptions have been amended
    to include the identity of candidates supported through these exempt volunteer
    activities.  No employee whose salary or benefits appears on schedule H4 spent
    more than 25 percent of their compensated time on Federal Election Activity this
    month.\n"
